import React, { Component } from 'react';
import './Todo.css';

class Todo extends Component {
	
	constructor(props){
		super(props);
		this.state = {
			length: 1,
			jobs: [
				<input type="text" placeholder="o_O ?" className="inp1"/>
			]
		}
	}
	
	render() {
		return(
			<div>
				this.state.jobs;
			</div>
		);
	}
}

export default Todo;
